# Definition for singly-linked list.# class ListNode:#     def __init__(self, x):#         self.val = x#         self.next = Noneclass Solution:    def middleNode(self, head):        """        :type head: ListNode        :rtype: ListNode        """        if not head:            return        cur=head        cur2=head        count=0        while cur:            count+=1            cur=cur.next        n=count//2        while n:            n-=1            cur2=cur2.next        return cur2s=Solution()target=5print(s.reachNumber(target))